import React, { useEffect, useRef } from "react";
import { LineChart } from "@opd/g2plot-react";
import { Line, Area } from "@antv/g2plot";

const config = {
    data: [
        { year: "1991", value: 3 },
        { year: "1992", value: 8 },
        { year: "1993", value: 3.5 },
        { year: "1994", value: 5 },
        { year: "1995", value: 8.9 },
        { year: "1996", value: 2 },
        { year: "1997", value: 7 },
        { year: "1998", value: 6 },
        { year: "1999", value: 9 }
    ],
    xField: 'Date',
    yField: 'scales',
    xAxis: {
        range: [0, 1],
        tickCount: 5,
    },
    areaStyle: () => {
        return {
            fill: 'l(270) 0:#ffffff 0.5:#7ec2f3 1:#1890ff',
        };
    },
};

function Graph2() {
    
    return (
        <Area chartRef= {config} />
    )
}

export default Graph2
